import React, { useEffect } from "react";
import { Grid } from "@mui/material";
import { BoxTeamPreview } from "./components/Box/BoxTeam/BoxTeamPreview";

import ReactFlow from "reactflow";

import "./App.css";

import "reactflow/dist/style.css";
import { BoxComponentPreview } from "./components/Box/BoxComponent";
import { useGetProductDTOQuery } from "./services/api";
import { edges, nodes } from "./reactFLow";

function App() {
  const { data, isError, isSuccess, isLoading } = useGetProductDTOQuery();

  if (isError) {
    console.error("Ошибка");
    return null;
  }

  return (
    <div className="App">
      <header className="App-header">
        <Grid container spacing={3} direction="column">
          <Grid item>
            {data?.team?.users && (
              <BoxTeamPreview
                name={data?.team?.name ?? ""}
                users={data?.team.users}
              />
            )}
          </Grid>
          <Grid item>
            {data?.components && (
              <BoxComponentPreview productComponents={data.components} />
            )}
          </Grid>
          <Grid item>
            <div style={{ width: "100vw", height: "50vh" }}>
              <ReactFlow nodes={nodes} edges={edges} />
            </div>
          </Grid>
        </Grid>
      </header>
      <main>
      </main>
    </div>
  );
}

export default App;
